import React from "react";
import { Doughnut } from "react-chartjs-2";

const Charts: React.FC = () => {
  // Dados de exemplo para o gráfico de pacientes por convênio
  const patientsByInsuranceData = {
    labels: ["Convênio A", "Convênio B", "Convênio C"],
    datasets: [
      {
        label: "Pacientes por Convênio",
        data: [30, 20, 50], //usar os dados reais obtidos do backend
        backgroundColor: ["#FF6384", "#36A2EB", "#FFCE56"],
        hoverBackgroundColor: ["#FF6384", "#36A2EB", "#FFCE56"],
      },
    ],
  };

  // Dados de exemplo para o gráfico de perfil dos pacientes
  const patientsProfileData = {
    labels: ["Crianças", "Adultos", "Idosos"],
    datasets: [
      {
        label: "Perfil dos Pacientes",
        data: [40, 50, 30], // Aqui você usaria os dados reais obtidos do backend
        backgroundColor: ["#FF6384", "#36A2EB", "#FFCE56"],
        hoverBackgroundColor: ["#FF6384", "#36A2EB", "#FFCE56"],
      },
    ],
  };

  return (
    <div>
      <h2>Gráficos</h2>
      <div>
        <h3>Pacientes por Convênio</h3>
        <Doughnut data={patientsByInsuranceData} />
      </div>
      <div>
        <h3>Perfil dos Pacientes</h3>
        <Doughnut data={patientsProfileData} />
      </div>
    </div>
  );
};

export default Charts;
